(11, 'A', '<p>Akan mengirimkan data dalam bentuk besaran-besaran listrik/fisik seperti tegangan, arus, gelombang radio maupun cahaya, sesuai media yang digunakan. Sehingga menimbulkan aliran listrik.</p>', 1, 9),
(12, 'B', '<p>Model referensi jaringan terbuka OSI atau OSI Reference Model for open networking adalah sebuah model arsitektural jaringan yang dikembangkan oleh badan International Organization for Standardization (ISO) di Eropa pada tahun 1977. OSI sendiri merupakan singkatan dari Open System Interconnection. Model ini disebut juga dengan model "Model tujuh lapis OSI" (OSI seven layer model). Sebelum munculnya model referensi OSI, sistem jaringan komputer sangat tergantung kepada pemasok (vendor). OSI berupaya membentuk standar umum jaringan komputer untuk menunjang interoperatibilitas antar pemasok yang berbeda. Dalam suatu jaringan yang besar biasanya terdapat banyak protokol jaringan yang berbeda. Tidak adanya suatu protokol yang sama, membuat banyak perangkat tidak bisa saling berkomunikasi</p>', 0, 9),
(13, 'C', '<p>Salah satu protokol lapisan transpor TCP/IP yang mendukung komunikasi yang tidak andal (unreliable), tanpa koneksi (connectionless) antara host-host dalam jaringan yang menggunakan TCP/IP.</p>', 0, 9),
(14, 'D', '<p>Keduanya memiliki layer (lapisan). Sama &ndash; sama memiliki Application layer meskipun memiliki layanan yang berbeda. Memiliki transport dan network layer yang sama, Asumsi dasar keduanya adalah menggunakan teknologi packet switching dan Dua-duanya punya transport dan network layer yang bisa diperbandingkan. TCP/IP mengombinasikan presentation dan session layer OSI ke dalam application layer.</p>', 0, 9),
(15, 'E', '<p>test</p>', 0, 9);
